-- Definizione tabelle DB
CREATE TABLE Istruttore (
	CF CHAR(16) PRIMARY KEY,
	Nome VARCHAR(20) NOT NULL,
	Cognome VARCHAR(20) NOT NULL,
	DataNascita DATE NOT NULL,
	Telefono CHAR(10) NOT NULL UNIQUE,
	Email VARCHAR(100) NOT NULL UNIQUE,
	Stipendio DECIMAL(6, 2) NOT NULL
);

CREATE TYPE TipoSpec AS ENUM (
	'Personal trainer',
	'Istruttore cardio',
	'Istruttore mobilità'
);

CREATE TABLE CertificazioneSportiva (
	Istruttore CHAR(16),
	DataRilascio DATE,
	Specializzazione TipoSpec NOT NULL,
	EnteCertificatore VARCHAR(50) NOT NULL,
	Scadenza DATE NOT NULL,
	PRIMARY KEY (Istruttore, DataRilascio),
	FOREIGN KEY (Istruttore) REFERENCES Istruttore(CF),
	CHECK (Scadenza > DataRilascio)
);

CREATE TABLE Cliente (
	CF CHAR(16) PRIMARY KEY,
	Nome VARCHAR(20) NOT NULL,
	Cognome VARCHAR(20) NOT NULL,
	DataNascita DATE NOT NULL,
	Telefono CHAR(10) NOT NULL UNIQUE,
	Email VARCHAR(100) NOT NULL UNIQUE,
	DataIscrizione DATE NOT NULL,
	NumIngressi INT NOT NULL DEFAULT 0
);

CREATE TABLE CheckIn (
	Cliente CHAR(16),
	DataOraIngresso TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY (Cliente, DataOraIngresso),
	FOREIGN KEY (Cliente) REFERENCES Cliente(CF) ON DELETE CASCADE
);

CREATE TABLE CertificatoMedico (
	Cliente CHAR(16),
	DataRilascio DATE NOT NULL,
	Scadenza DATE NOT NULL,
	Dottore VARCHAR(40) NOT NULL,
	PRIMARY KEY (Cliente),
	FOREIGN KEY (Cliente) REFERENCES Cliente(CF) ON DELETE CASCADE,
	CHECK (Scadenza > DataRilascio)
);

CREATE TABLE Abbonamento (
	Codice INT PRIMARY KEY,
	Prezzo DECIMAL(6, 2) NOT NULL,
	Durata INT NOT NULL,
	AccessoLibero BOOL NOT NULL DEFAULT FALSE,
	AccessoCorsi BOOL NOT NULL DEFAULT FALSE,
	CHECK (AccessoLibero OR AccessoCorsi)
);

CREATE TABLE Iscrizione (
	Cliente CHAR(16),
	DataInizio DATE,
	Sconto INT NOT NULL DEFAULT 0,
	DataFine DATE NOT NULL,
	Abbonamento INT NOT NULL,
	PRIMARY KEY (Cliente, DataInizio),
	FOREIGN KEY (Cliente) REFERENCES Cliente(CF),
	FOREIGN KEY (Abbonamento) REFERENCES Abbonamento(Codice),
	    CHECK (DataFine > DataInizio)
);

CREATE TYPE TipoMetodo AS ENUM (
	'Contanti',
	'Elettronico'
);

CREATE TABLE Pagamento (
	Cliente CHAR(16),
	Iscrizione DATE,
	NumRata INT,
	Metodo TipoMetodo NOT NULL,
	Data TIMESTAMP NOT NULL,
	Importo DECIMAL(6, 2) NOT NULL,
	PRIMARY KEY (Cliente, Iscrizione, NumRata),
	FOREIGN KEY (Cliente, Iscrizione) REFERENCES Iscrizione(Cliente, DataInizio)
);

CREATE TYPE TipoScheda AS ENUM (
	'Massa',
	'Tonificazione'
);

CREATE TABLE Scheda (
	Codice INT PRIMARY KEY,
	Tipologia TipoScheda NOT NULL,
	DataCreazione DATE NOT NULL,
	Cliente CHAR(16) NOT NULL,
	FOREIGN KEY (Cliente) REFERENCES Cliente(CF)
);

CREATE TYPE TipoSala AS ENUM (
	'Sala attrezzi',
	'Sala corsi'
);

CREATE TABLE Sala(
	Nome VARCHAR(16) PRIMARY KEY,
	Tipo TipoSala NOT NULL,
	Capienza INT NOT NULL
);

CREATE TYPE TipoAttrezzo AS ENUM(
	'A carico',
	'Isotonico',
	'Cardio',
	'Funzionale'
);

CREATE TABLE Attrezzatura(
	CodiceAttrezzatura INT PRIMARY KEY,
	Nome VARCHAR(16) NOT NULL,
	Tipo TipoAttrezzo NOT NULL,
	Sala VARCHAR(16) NOT NULL,
	FOREIGN KEY (Sala) REFERENCES Sala(Nome)
);

CREATE TABLE Manutenzione (
	Attrezzatura INT,
	DataInizio DATE,
	Descrizione VARCHAR(100) NOT NULL,
	DataFine DATE DEFAULT NULL,
	PRIMARY KEY (DataInizio, Attrezzatura),
	FOREIGN KEY (Attrezzatura) REFERENCES Attrezzatura(CodiceAttrezzatura),
        CHECK (DataFine > DataInizio)
);

CREATE TABLE Esercizio(
	Nome VARCHAR(16) PRIMARY KEY,
	StepsSvolgimento VARCHAR(100) NOT NULL
);

CREATE TABLE Comporre (
	Scheda INT,
	Esercizio VARCHAR (16),
	Note VARCHAR (100) NOT NULL,
	SerieRipetizioni VARCHAR(10),
	Recupero INT NOT NULL,
	PRIMARY KEY (Scheda, Esercizio),
	FOREIGN KEY (Scheda) REFERENCES Scheda(Codice),
	FOREIGN KEY (Esercizio) REFERENCES Esercizio(Nome)
);

CREATE TYPE TipoLivello AS ENUM(
	'Base',
	'Intermedio',
	'Avanzato'
);

CREATE TABLE Corso (
	Nome VARCHAR(20) PRIMARY KEY,
	DurataLezione INT NOT NULL,
	Descrizione VARCHAR(100) NOT NULL,
	Livello TipoLivello NOT NULL,
	Sala VARCHAR(16) NOT NULL,
	FOREIGN KEY (Sala) REFERENCES Sala(Nome)
);

CREATE TABLE Lezione (
	Corso VARCHAR(20),
	DataOra TIMESTAMP,
	Istruttore CHAR(16) NOT NULL,
	PRIMARY KEY (Corso, DataOra),
	FOREIGN KEY (Corso) REFERENCES Corso(Nome),
	FOREIGN KEY (Istruttore) REFERENCES Istruttore(CF)
);

CREATE TABLE Prenotazione (
	Corso VARCHAR(20),
	Lezione TIMESTAMP,
	Cliente CHAR(16),
	Presenza BOOL NOT NULL DEFAULT FALSE,
	PRIMARY KEY (Corso, Lezione, Cliente),
	FOREIGN KEY (Corso, Lezione) REFERENCES Lezione(Corso, DataOra),
	FOREIGN KEY (Cliente) REFERENCES Cliente(CF)
);

-- Query 1
SELECT c.CF, c.Nome, c.Cognome, i.DataInizio, i.DataFine,
    SUM(p.Importo) AS TotalePagato,
    ROUND(a.Prezzo * (1 - i.Sconto / 100.0), 2) AS PrezzoIscrizione,
    (ROUND(a.Prezzo * (1 - i.Sconto / 100.0), 2) - SUM(p.Importo)) AS SaldoResiduo
FROM Cliente c
JOIN Iscrizione i ON c.CF = i.Cliente
JOIN Abbonamento a ON i.Abbonamento = a.Codice
JOIN Pagamento p ON i.Cliente = p.Cliente AND i.DataInizio = p.Iscrizione
WHERE i.DataFine >= CURRENT_DATE
GROUP BY c.CF, c.Nome, c.Cognome, i.DataInizio, i.DataFine, a.Prezzo, i.Sconto
HAVING ((a.Prezzo * (1 - i.Sconto / 100.0)) * (50.0 / 100.0)) <= (ROUND(a.Prezzo * (1 - i.Sconto / 100.0), 2) - SUM(p.Importo))
ORDER BY SaldoResiduo DESC

-- Query 2
SELECT c.CF, c.Nome, c.Cognome, COUNT(*) AS Assenze
FROM Cliente c
JOIN Prenotazione p ON c.CF = p.Cliente
WHERE Presenza = FALSE
GROUP BY c.CF, c.Nome, c.Cognome
HAVING COUNT(*) >= 5

-- Query 3
SELECT a.*, COUNT(DISTINCT i.Cliente) AS Clienti
FROM Abbonamento a
LEFT JOIN Iscrizione i ON a.Codice = i.Abbonamento
GROUP BY a.Codice
ORDER BY Clienti DESC

-- Query 4
SELECT DISTINCT CF, Nome, Cognome, Num_prenotazioni
FROM (
    SELECT I.CF, I.Nome, I.Cognome, COUNT(*) AS Num_prenotazioni
    FROM Istruttore I
    JOIN Lezione L ON I.CF = L.Istruttore
    JOIN Prenotazione P ON P.Lezione = L.DataOra AND P.Corso = L.Corso
    WHERE P.Presenza = TRUE
    GROUP BY I.CF, I.Nome, I.Cognome, L.Corso, L.DataOra
    HAVING COUNT(*) = (
        SELECT MAX(Num_prenotazioni)
            FROM (
                SELECT COUNT(*) AS Num_prenotazioni
                FROM Lezione L
                JOIN Prenotazione P ON P.Lezione = L.DataOra AND P.Corso = L.Corso
                WHERE P.Presenza = TRUE
                GROUP BY L.Corso, L.Dataora
        ) AS Prenotazioni
    )
) AS IstruttoriTop

-- Query 5
SELECT S.Nome, COUNT (*) AS Manutenzioni_Attive
FROM Sala S
JOIN Attrezzatura A ON A.Sala = S.Nome
JOIN Manutenzione M ON M.Attrezzatura = A.CodiceAttrezzatura
WHERE M.DataFine IS NULL
GROUP BY S.Nome
ORDER BY Manutenzioni_Attive DESC

-- Indici per Q1 e Q4
CREATE INDEX idx_datafine_iscr ON Iscrizione(DataFine);
CREATE INDEX idx_lezione ON Lezione(Corso, DataOra);

